import React, { Component } from 'react';
import '../../styles/guest/carrousel.css';

import tasks from '../../task.json';

class guest extends Component{

    state = {
        tasks: tasks
    }

    render(){
        return <div>
            <div class = "box"></div>
            {               
                this.state.tasks.map(e => {
                        e.departamento.puestos.puesto.map(er =>
                            <div class="container-fluid">
                            <div class="container">
                            <div class="row">
                                <div class="col-sm-4">
                                <div class="card text-center">
                                    <div class="title">
                                    <i class="fa fa-paper" aria-hidden="true"></i>
                                    <h2>{er.nombre}</h2>
                                    </div>
                                    <div class="price">
                                    <h4>25</h4>
                                    </div>
                                    <div class="option">
                                        <ul>
                                        <li> <i class="fa fa-check" aria-hidden="true"></i>  </li>
                                        <li> <i class="fa fa-check" aria-hidden="true"></i> 3 Domain Names </li>
                                        <li> <i class="fa fa-check" aria-hidden="true"></i> 20 Email Address </li>
                                        <li> <i class="fa fa-times" aria-hidden="true"></i> Live Support </li>
                                        </ul>
                                    </div>
                                    <a>Order Now </a>
                                </div>
                                </div>
                            </div>
                            </div>
                            </div>
                        )
                    } 
                )
            }
        </div> 
    }
}

export default guest;
